/**
 * @author [Alex Neo]
 * @email [alex.neo0115@gmail.com]
 * @create date 2022-01-12 19:33:03
 * @modify date 2022-01-12 19:33:03
 * @desc [create counter view]
*/
import React from "react";
import PropTypes from "prop-types";

const CounterView = ({ value, onIncreaseClick, onDecreaseClick }) => (
	<div style={{width:'200px', height:'30px'}}>
        <span style={{color:white}}>{value}</span>
        <button onClick={onIncreaseClick}>Increase</button>
        <button onClick={onDecreaseClick}>Decrease</button>
    </div>
);


CounterView.propTypes = {
	value: PropTypes.number.isRequired,
	onIncreaseClick: PropTypes.func,
	onDecreaseClick: PropTypes.func
};

export default CounterView;
